    const onChangeInsertData = (e) => {
        console.log(e)
        // setInsertDatas()
    }

    return (
        <div id="id_filter">
            <div>
                <label>검색어:</label>
                <input type='text' />
            </div>

            <div>
                <p>붙여넣을 텍스트</p>
                <textarea onChange={onChangeInsertData}/>
            </div>

            <div>
                <p>붙여넣을 텍스트</p>
                <textarea />
            </div>
        </div>
    );
}

export default IdFilter;
